import React from 'react';
import ReactDOM from 'react-dom';
import profile1 from './image/profile1.png'
import profile2 from './image/profile2.png'
import profile3 from './image/profile3.png'
import SingleComment from './SingleComment';

const App = () => {
    return(
        <div className = "ui comments">
           <SingleComment name = "Oneesan" message = "Ara ara" time = "Today at 4:00AM"/>
           <SingleComment name = "Femboy" message = "Femboy cock" time = "Today at 5:00AM" img src  = {profile2}/> 
           <SingleComment name = "Milf"  message = "So hot" time = "Today at 6:00AM" img src  = {profile3}/>    
        </div>
    )
}

ReactDOM.render(
    <App />,
    document.querySelector('#root')
)
